import React from "react";
import styles from "./ContainerCard.module.scss";
import Link from "next/link";
import {useRouter} from "next/router";

export function ContainerCard() {
  const routerObject = useRouter();
  console.log(routerObject);
  const location = routerObject.query;

  return (
    <div className={styles.container}>
      <img className={styles.containerImg} src="/static/images/container.svg" alt="illustration container" />
      <div className={styles.type}>
        <h1>Container </h1>
      </div>

      <div className={styles.PriceWrapper}>
        <h2 className={styles.h2}>13,8 kvm2</h2>
        <h2 className={styles.h2}>800kr/m√•n</h2>
      </div>

      <Link href="/container/[location]/[containerForm]" as={`/container/${location}/containerForm`}>
        <button className={styles.button}>Boka</button>
      </Link>
    </div>
  );
}
